//import "./Radio.css";
const Radio=(props)=>{
    return(
        <div>
            <label htmlFor={props.name}>{props.label}</label>
            <input id={props.id} name={props.name} type="radio" checked={props.checked} onChange={props.onChange}/>

        </div>
    )
}


export default Radio;
